import React from "react";
import {Link, useParams } from 'react-router-dom';

export default function Product({products}) {
   const {url} = useParams ();
   
        return (
        <ul>
            {products.map(product=>
            <li key={product.id}>
                <Link to={`${url}/${product.id}`}>
                {product.name}
                </Link>
            </li>)}
        </ul>
    )     
}
